import React from "react";
import { Button, Stack, Link } from "@mui/material";

const SignIn = () => {
    return( <Stack sx={{ml: -1, mr: -1}} paddingTop='75px' textAlign='center' color={"text.primary"} bgcolor={"background.default"}>
    <h1>Sign In</h1>
    <p>This Website is a place to upload recipes, view other people's recipes, get feedback on recipes, and keep track of your fridge and pantry.</p>
    <Stack sx={{margin: "10px auto"}} textAlign='center' direction="row" spacing={5}>
        <Button variant="contained"><Link style={{textDecoration: "none", color:"white"}} to={`/signin`}>
                Sign In
                </Link></Button>
        <Button variant="contained">Register</Button>
    </Stack>
</Stack>);
}

export default SignIn;
